ext($ctrl, $item) {}","","/**"," * Get the number of columns in the pwbo control,"," *"," * @param $ctrl"," *"," * @return int"," */","function wbtemp_get_listview_columns($ctrl) {}","","/**"," * @param $ctrl"," * @param $i"," * @param $text"," * @param $width - If nWidth is negative, calculate width automatically"," * @param $align - WBC_LEFT, WBC_RIGHT, WBC_CENTER"," *"," * @return int"," */","function wbtemp_create_listview_column($ctrl, $i, $text, $width, $align) {}","","/**"," * @param $ctrl"," *"," * @return int"," */","function wbtemp_clear_listview_columns($ctrl) {}","","/**"," * @param $ctrl"," * @param $item"," * @param $selected"," *"," * @return int"," */","function wbtemp_select_listview_item($ctrl, $item, $selected) {}","","/**"," * @param $ctrl"," * @param $bool"," *"," * @return int"," */","function wbtemp_select_all_listview_items($ctrl, $bool) {}","","/**"," * @param $parent"," * @param $caption"," *"," * @return int"," */","function wbtemp_create_menu($parent, $caption) {}","","/**"," * @param $ctrl"," * @param $item"," *"," * @return int"," */","function wbtemp_get_menu_item_checked($ctrl, $item) {}","","/**"," * @param $ctrl"," * @param $selitems"," * @param $selected"," *"," * @return int"," */","function wbtemp_set_menu_item_checked($ctrl, $selitems, $selected) {}","","/**"," * @param $ctrl"," * @param int $item"," * @param bool $selected"," *"," * @return int"," */","function wbtemp_set_menu_item_selected($ctrl, $item, $selected) {}","","/**"," * @param $ctrl"," * @param $item"," * @param $imageHandle"," *"," * @return int"," */","function wbtemp_set_menu_item_image($ctrl, $item, $imageHandle) {}","","/**"," * @param $parent"," * @param $caption"," * @param $width"," * @param $height"," * @param $lparam"," *"," * @return int"," */","function wbtemp_create_toolbar($parent, $caption, $width, $height, $lparam) {}","","/**"," * @param $ctrl"," * @param $name"," * @param $value"," * @param $where"," * @param $image_index"," * @param $selected_imag